import * as React from 'react';
import { Button, View, Text, Image, StyleSheet, TouchableOpacity, Alert } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { SplashScreen } from 'expo';
import a from './assets/A.gif'; 



SplashScreen.preventAutoHide();
setTimeout(SplashScreen.hide, 6000);


function CategoriesScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>

      <Text>Put Categories Here</Text>

      <TouchableOpacity 
    		onPress={() => navigation.navigate('Alphabet')}
       >
			<Image source={a} 
				style={styles.smallButtons}
			/>
      </TouchableOpacity> 

      <Button
        title="Alphabet"
        onPress={() => navigation.navigate('Alphabet')}
      />

      <Button
        title="Planets"
        onPress={() => navigation.navigate('Planets')}
      />

    </View>
  );
}


function AlphabetScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>

      <TouchableOpacity 
    		onPress={() => navigation.navigate('A')}
       >
			<Image source={a} 
				style={styles.bigButtons}
			/>
      </TouchableOpacity> 

      <Text>Browse All</Text>
      <Button
        title="Go to Alphabet... again"
        onPress={() => navigation.push('Alphabet')}
      />
      <Button title="Go to Categories" onPress={() => navigation.navigate('Categories')} />
      <Button title="Go back" onPress={() => navigation.goBack()} />
    </View>
  );
}


function AScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>

      <TouchableOpacity 
    		onPress={() => navigation.navigate('Alphabet')}
       >
			<Image source={a} 
				style={styles.roundButton}
			/>
      </TouchableOpacity> 

    </View>
  );
}


function PlanetsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Planets Screen</Text>
      <Button
        title="Go to Planets... again"
        onPress={() => navigation.push('Planets')}
      />
      <Button title="Go to Categories" onPress={() => navigation.navigate('Categories')} />
      <Button title="Go back" onPress={() => navigation.goBack()} />
    </View>
  );
}

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Categories">
        <Stack.Screen 
        	name="Categories" 
        	component={CategoriesScreen}
        	options={{ title: 'Categories'}}
        />
        <Stack.Screen
        	name="Alphabet"
        	component={AlphabetScreen}
        	options={{ title: 'Alphabet'}}
        />
        <Stack.Screen
        	name="A"
        	component={AScreen}
        	options={{ title: 'A'}}
        />
        <Stack.Screen
        	name="Planets"
        	component={PlanetsScreen}
        	options={{ title: 'Planets'}}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;



const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    smallButtons: {
    	height: 134,
    	width: 126,
    	marginTop:10,
	    paddingTop:15,
	    paddingBottom:15,
	    marginLeft:30,
	    marginRight:30,
	    borderRadius:6,
	    borderWidth: 0.5,
	    borderColor: 'black'
    },
    bigButtons: {
    	height: 481,
    	width: 343,
    	marginTop:10,
	    paddingTop:15,
	    paddingBottom:15,
	    marginLeft:30,
	    marginRight:30,
	    borderRadius:30,
	    borderWidth: 0.5,
	    borderColor: 'black'

    },
    roundButton: {
    	height: 50,
    	width: 50,
    	borderRadius: 100,
        flex: 1,
        flexDirection: 'row',
        alignItems: 'flex-start',
        borderWidth: 0.5,
	    borderColor: 'black'
    }

});
